() => {
  let arrValues = Object.values(Data.GetUserSpendingByMonth(4));
  let arrKeys = Object.keys(Data.GetUserSpendingByMonth(4));
  return arrKeys.map((k, i) => {
    return [arrValues[i], k];
  }).slice(3, 10).sort().reverse().slice(0, 3).map(x => {
    return {
      label: x[1],
      value: x[0]
    };
  });
}

